import "./App.css";

// Example of a data array that
// you might receive from an API
const data = [
  { b: 1, i: 2, n: 3, g: 4, o: 5 },
  { b: 1, i: 2, n: 3, g: 4, o: 5 },
  { b: 1, i: 2, n: "FREE SP", g: 4, o: 5 },
  { b: 1, i: 2, n: 3, g: 4, o: 5 },
  { b: 1, i: 2, n: 3, g: 4, o: 5 },
];

function App() {
  return (
    <div className="App">
      <table>
        <tr>
          <th>B</th>
          <th>I</th>
          <th>N</th>
          <th>G</th>
          <th>O</th>
        </tr>
        {data.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.b}</td>
              <td>{val.i}</td>
              <td>{val.n}</td>
              <td>{val.g}</td>
              <td>{val.o}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}

export default App;
